pragma solidity >=0.4.21 <0.6.0;

contract Leaderboard {event __CoverageLeaderboard(string fileName, uint256 lineNumber);
event __FunctionCoverageLeaderboard(string fileName, uint256 fnId);
event __StatementCoverageLeaderboard(string fileName, uint256 statementId);
event __BranchCoverageLeaderboard(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageLeaderboard(string fileName, uint256 branchId);
event __AssertPostCoverageLeaderboard(string fileName, uint256 branchId);

    address[] private players;
    mapping (address => uint) public player_ETH;
    address public firstPlacePlayer = address(0);

    function _updateFirstPlace(address _address) private{emit __FunctionCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',1);

        // The ETH that you get needs to be greater than the first place player who is in the first time.
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',10);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',1);
if (player_ETH[_address] > player_ETH[firstPlacePlayer]) {emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',1,0);
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',11);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',2);
firstPlacePlayer = _address;
        }else { emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',1,1);}

    }

    function enterLeaderBoard(address _address, uint winAmount) internal {emit __FunctionCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',2);

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',16);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',3);
if (!_isInLeaderBoard(_address)) {emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',2,0);
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',17);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',4);
players.push(_address);
        }else { emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',2,1);}

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',19);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',5);
player_ETH[_address] += winAmount;
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',20);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',6);
_updateFirstPlace(_address);
    }

    function _isInLeaderBoard(address _address) private      returns(bool) {emit __FunctionCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',3);

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',24);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',7);
for (uint i = 0; i < players.length ; i++) {
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',25);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',8);
if (players[i] == _address) {emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',3,0);
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',26);
                emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',9);
return true;
            }else { emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',3,1);}

        }
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',29);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/Smart-Contract-Modular-Template/TCI Examples/Gamble/contracts/Leaderboard.sol',10);
return false;
    }
}
